export default class App extends Component {

    showTemplate() {
        console.log();
    }

    render() {
        return (
            <div>
                <h1>Panal</h1>
            </div>
        )
    }
}

class conponect extends Component {
    render() {
        return (
            <template id="follow-me-template">
            <div>
                <div style={ styles.followme }>
                    <h3>Follow me</h3>
                    <a style={ styles.a } href="https://www.facebook.com/siamhtml">facebook</a>
                    <a style={ styles.a } href="https://twitter.com/SuranartN">twitter</a>
                </div>
            </div>
            </template>
        )
    }
}


const styles = {
    followme : {
    width: '15%',
    padding: '10px'
    },
    a : {backgroundColor : 'grey', color : '#fff' , padding : 10}
  }
